    }



    render(){    

        return(
            <div>
            <div>
                {this.renderRedirect()}
            </div>
            <Card title={this.props.name} extra={<a href="#">{this.props.id}</a>} style={{ marginBottom:'20px',height:200,width: 'auto', textAlign:'left'}}>
            <p >{this.props.status}</p>
            <p>Card content</p>

            <div style={{textAlign:'left'}}>
                <Button type="primary" onClick={this.getMore} >More</Button>
            </div>
        </Card>
        </div>
        )
    }
}

export default MatchedClientCard
